To create an instance of a class in Python, you use the following syntax:

```
class ClassName:
    attributes = []
    def __init__(self):
        self.attributes = []
    def method1():
        self.attributes.append('value1')
    def method2():
        self.attributes.append('value2')
    def method3():
        self.attributes.append('value3')
```

In this example, `ClassName` is the name of the class, `attributes` is a list of attributes that the class can have, and `def __init__(self):` is the constructor method that is called when an instance of the class is created.

